  [],\n\t\"revision_timestamp\": \"2015-09-27T00:03:30.358931\",\n\t\"name\": \"noaa-office-for-coastal-management-coastal-inundation-digital-elevation-model-houston-galveston\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This digital elevation model (DEM) is a
  part of a series of DEMs produced for the National Oceanic and Atmospheric Administration
  Office for Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer.
  The DEM includes the best available lidar data known to exist at the time of DEM
  creation that meets project specifications for those counties within the boundary
  of the Houston/Galveston TX Weather Forecast Office (WFO), as defined by the NOAA
  National Weather Service. The counties within this boundary are: Jackson, Matagorda,
  Brazoria (portion), Harris (portion), Galveston, and Chambers. For all the counties
  listed, except for Harris, the DEM is derived from LiDAR data sets collected for
  the Texas Water Development Board (TWDB) in 2006 with a point density of 1.4 m GSD.
  LiDAR data for Harris County was collected in October 2001 by the Harris County
  Flood Control District Tropical Storm Allison Recovery Project (TSARP) with a point
  density of 2.0 m GSD. Hydrographic breaklines used in the creation of the DEM were
  delineated using LiDAR intensity imagery generated from the data sets. The DEM is
  hydro flattened such that water elevations are less than or equal to 0 meters. The
  DEM is referenced vertically to the North American Vertical Datum of 1988 (NAVD88)
  with vertical units of meters and horizontally to the North American Datum of 1983
  (NAD83). The resolution of the DEM is approximately 10 meters.\",\n\t\"license_title\":
